export default function TextField({
  type = 'text',
  name,
  value,
  label,
  onChange,
  autoComplete,
  error,
}) {
  return (
    <div className='form-group'>
      <label htmlFor={name}>{label}</label>
      <input
        type={type}
        name={name}
        value={value}
        onChange={onChange}
        autoComplete={autoComplete}
      />

      {error && <span className='error'>{error}</span>}
    </div>
  );
}
